const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');

const image1 = new Image();
image1.src = 'data:image/png;base64,';

const inputSlider = document.getElementById('resolution');
const inputLabel = document.getElementById('resolutionLabel');
// inputSlider.addEventListener('change', handleSlider);

class Cell{
    constructor(x,y, symbol, color){
        this.x = x;
        this.y = y;
        this.symbol = symbol;
        this.color = color;
    }
    draw(ctx) {
        ctx.globalAlpha = 0.3; //opacity
        ctx.fillStyle = this.color;
        ctx.fillText(this.symbol, this.x, this.y);
        ctx.globalAlpha = 1; // Reset to full opacity for subsequent drawings
    }
}

class AsciiEffect {
    #imageCellArray = [];
    #symbols = [];
    #pixels = [];
    #ctx;
    #width;
    #height;
    constructor(ctx, width, height){
        this.#ctx = ctx;
        this.#width = width;
        this.#height = height;
        this.#ctx.drawImage(image1, 0,0, this.#width, this.#height);
        this.#pixels = this.#ctx.getImageData(0,0,this.#width, this.#height); //gets the x,y coordinates and pixel data
        console.log(this.#pixels.data);
    }
    #convertToSymbol(g){
        if (g>250) return '@' //light colored areas
        else if (g>240) return '*'
        else if (g>220) return '+'
        else if (g>210) return '#'
        else if (g<200) return '&'
        else if (g>180) return '%'
        else if (g>160) return '_'
        else if (g>140) return '$'
        else if (g>120) return '/'
        else if (g>100) return 'x'
        else if (g>80) return 'o'
        else if (g>60) return 'c'
        else if (g>40) return 'w'
        else if (g>20) return '-'
        else return '';
    }
    #scanImage(cellSize){
        this.#imageCellArray = [];
        for(let y=0; y< this.#pixels.height; y+=cellSize){ //cycle through rows and columns of image
            for(let x=0; x< this.#pixels.width; x+=cellSize){
                const posX = x*4; //each pixel is every 4 positions
                const posY = y*4;
                const pos = (posY * this.#pixels.width) + posX; //index of pixel cells

                if(this.#pixels.data[pos + 3]>128){ //if alpha values over 128 (not transparent) -> get average color of each pixel cell and assign it an ascii symbol
                    const red = this.#pixels.data[pos];
                    const green = this.#pixels.data[pos + 1];
                    const blue = this.#pixels.data[pos + 2];
                    const total = red + green + blue;
                    const averageColorValue = total/3;
                    const color = `rgb( ${red} , ${green} , ${blue})`
                    const symbol = this.#convertToSymbol(averageColorValue);
                    if(total>200) this.#imageCellArray.push(new Cell(x,y,symbol,color)); //exlucde color black from having a symbol
                }
            }
        }
        console.log(this.#imageCellArray);
    }
    #drawAscii(){
        this.#ctx.clearRect(0,0,this.#width, this.#height);
        for(let i=0; i<this.#imageCellArray.length; i++){
            this.#imageCellArray[i].draw(this.#ctx);
        }
    }
    draw(cellSize){
        this.#scanImage(cellSize);
        this.#drawAscii();
    }
}
